import React from 'react'
import "./Profile.css"
import { useState } from 'react'
function Profile() {
    let[state,setState]=useState("data:image/jpeg;base64,");
    let[data,setData]=useState({
        nm:"",
        email:"",
        gender:"",
        description:""
    })
    let[theme,setTheme]=useState({
        bgcolor:"",
        color:"",
        title:""
    })
    const changeTheme=(event)=>{
   if(event.target.checked)
   {
     setTheme({
        bgcolor:"black",
        color:"white",
        title:"CHANGE TO DARK MODE"
     })
   
   }
    else{
        setTheme({
            bgcolor:"white",
            color:"black",
            title:"CHANGE TO LIGHT MODE"
         })
    }
    }
    const changeRajat=()=>{
        setState("data:image/jpeg;base64,");
        setData({
           nm:"RAJAT",
           email:"rj@gmail.com",
           gender:"MALE",
           description:"HE IS A MARKETING PROFESSIONAL"
        })
    }
    const changeRiya=()=>{
        setState("data:image/jpeg;base64,");
        setData({
            nm:"RIYA",
            email:"ry@gmail.com",
            gender:"FEMALE",
            description:"SHE IS A IT PROFESSIONAL"
         })
    }
    return (
    <div className='mainContainer'>
     
      <div className='leftConatiner'>
        <img src={state}
        height={200}
        width={200}
        alt="NO IMAGE"/>
      </div>
      <div className='rightContainer' style={{backgroundColor:theme.bgcolor,color:theme.color}}>
       <h2>NAME:{data.nm}</h2>
       <h2>EMAIL:{data.email}</h2>
       <h2>GENDER:{data.gender}</h2>
       <h2>DESCRIPTION:{data.description}</h2>
       <button style={{backgroundColor:"black",color:"white",padding:"15px"}} onClick={changeRajat}>RAJAT</button> &nbsp;&nbsp;
       <button style={{backgroundColor:"black",color:"white",padding:"15px"}} onClick={changeRiya}>RIYA</button>
       <br/><br/>
       <input type="checkbox" onChange={changeTheme}/>
       <h2>TITLE:{theme.title}</h2>
      </div>
    </div>
  )
}

export default Profile
